INSERT INTO `t_film` VALUES ('3a803a8725db3268a99a6dc083247312', '刺杀小说家', '2021-02-12', '科幻', '1', '内地', '7', '异世界皇都，天神赤发鬼残暴统治，滥杀无辜。少年空文因被赤发鬼追杀，决定奋起反击。在黑甲的指引下，踏上了凡人弑神之路。这是小说家路空文笔下的奇幻世界。没想到小说的进程，竟然影响着现实世界。这时一名男子接下了刺杀他的任务…\n', 'http://localhost:8888/api/upload?id=a861084a-5f11-4424-8919-c27adb286ac4', '130');
INSERT INTO `t_film` VALUES ('3cc2178c1581c7cd680bdd33d6d2522d', '人潮汹涌', '2021-02-12', '爱情', '1', '内地', '0', '2021年，你做好准备换个活法，牛转乾坤了吗？ 顶级杀手周全（刘德华 饰）和落寞群演陈小萌（肖央 饰）在一次意外中交换了身份。杀手在跌入谷底的过程中，重新审视了爱情和生活；群演在冒充杀手的过程中，彻底重塑了人生。两个人一起历经的荒诞，有啼笑皆非，更有热血沸腾。', 'http://localhost:8888/api/upload?id=19b18af7-e0bd-4add-99cd-c96bf87c651e', '119');
INSERT INTO `t_film` VALUES ('7555aa5256f2b00312d1bdf3c81e0ba1', ' 你好，李焕英', '2021-02-12', '喜剧', '1', '中国大陆', '0', '2001年的某一天，刚刚考上大学的贾晓玲（贾玲 饰）经历了人生中的一次大起大落。一心想要成为母亲骄傲的她却因母亲突遭严重意外，而悲痛万分。在贾晓玲情绪崩溃的状态下，竟意外的回到了 1981 年，并与年轻的母亲李焕英（张小斐 饰）相遇，二人形影不离，宛如闺蜜。与此同时，也结识了一群天真善良的好朋友。晓玲以为来到了这片“广阔天地”，她可以凭借自己超前的思维，让母亲“大有作为”，但结果却让晓玲感到意外......', 'http://localhost:8888/api/upload?id=22d08ce7-a5c5-40b9-949d-e873e221ac19', '128');
INSERT INTO `t_film` VALUES ('7805ad5309cd299e6a9cd207885c110e', '受益人 (2019)', '2019-11-08', '爱情', '1', '内地', '0', '吴海（大鹏 饰）为了给罹患哮喘的6岁儿子治病，在好友钟振江（张子贤 饰）的怂恿下，刻意结识了一个与他同样身处边缘和底层的网络女主播淼淼（柳岩 饰），决心酝酿一场别有用心的婚姻骗局……', 'http://localhost:8888/api/upload?id=23fe1d48-a61c-4fad-a19d-69cf041b589a', '112');
INSERT INTO `t_film` VALUES ('7de8f7343ff1ad772a2aa32286ff0a43', '新神榜：哪吒重生', '2021-02-12', '动作', '1', '内地', '0', '三千年前，天下动荡，人神共遇大劫，不想哪吒的一缕魂魄逃脱天罗地网，世世转世投胎，这一世与东海市酷爱机车的热血青年李云祥人神共生。然而龙族对哪吒恩怨并未善罢甘休，有着哪吒元神的李云祥，亦无法逃脱被龙族赶尽杀绝的宿命。东海危在旦夕，李云祥是否能够与哪吒元神并肩作战，成为抵抗龙族的英雄？东海市的子民能否得到拯救？', 'http://localhost:8888/api/upload?id=e880e0a7-aa0c-4127-97a6-e5fb1db1e07a', '116');
INSERT INTO `t_film` VALUES ('880155346cf8a2af01a68454e663daa8', '哥斯拉大战金刚 Godzilla vs Kong (2021)', '2021-03-26', '科幻', '1', '内地', '2', '这两位宛如神衹一般强大的对手于一场壮观的战争中相遇，彼时世界命运正悬于一线。为了找到真正的家园，金刚与他的保护者们踏上了一次艰难的旅程。与他们一道前行的还有一个年轻的孤儿女孩——吉雅，这个女孩与金刚之间存在着一种独特而强大的紧密联系。但意想不到的是，他们在前行的航道上与愤怒的哥斯拉狭路相逢，也由此在全球引起了一系列破坏。一股无形的力量造成了这两只巨兽之间的巨大冲突，深藏在地心深处的奥秘也由此揭开。', 'http://localhost:8888/api/upload?id=29322eaf-e01f-4c2b-a12c-514159023aba', '116');
INSERT INTO `t_film` VALUES ('89a685011d549262cac3017aa8bd73e5', '日不落酒店 (2021)', '2021-03-19', '喜剧', '1', '内地', '0', '故事发生在一家复古英式酒店，经理石月（黄才伦 饰），从工作到生活，过得像数学公式，无瑕疵且没毛病，年复一年如出一辙。无聊日子终于被一个意外假期所颠覆，妻子橘子（张慧雯 饰）怀孕、乌龙旅途、神秘房客……匪夷所思的离奇事件不断上演，无趣严谨的生活被打破，通关打怪般的解决危机 ，新生活会不会就在眼前……', 'http://localhost:8888/api/upload?id=cae258a5-0f5a-4262-87e4-6c80332c6701', '120');
INSERT INTO `t_film` VALUES ('953a0dde42ca3a7d44be7357e90c8cec', '21座桥 21 Bridges (2019)', '2021-03-19', '动作', '1', '内地', '0', '事业失意的纽约警探安德烈·戴维斯（查德维克·博斯曼 饰）意外被任命追捕一起重大涉毒杀人案的凶手。在这个骇人听闻的案件中，八名警察惨遭谋杀。为了让凶手尽快落网，戴维斯开启了曼哈顿历史上第一次全境封锁，岛上与外界联系的21座桥全部禁止出入。但封锁时间只有四个小时，戴维斯必须在天亮之前抓到凶手！在紧张的追捕行动中，戴维斯发现凶手也同样在被追杀，这起案件背后可能藏着一个滔天阴谋，他必须在一切不可挽回之前找出凶手并查明真相。', 'http://localhost:8888/api/upload?id=1e8b5c3e-e150-43af-ab5c-4f228c3a2a79', '120');
INSERT INTO `t_film` VALUES ('99e5885d66cc8b69893294ae73132920', '狮子王 The Lion King (2019)', '2019-07-12', '动画', '1', '内地', '0', '广袤无垠的非洲大草原，祥和奋进的荣耀王国迎来了光辉时刻。威严而勇敢的狮子国王木法沙（詹姆斯·厄尔·琼斯 James Earl Jones 配音）与王后沙拉碧（阿尔法·伍达德 Alfre Woodard 配音），终于迎来了他们的儿子——王国未来的王者辛巴（唐纳德·格洛弗 Donald Glover 配音）——的诞生。在所有的动物都心悦诚服跪拜辛巴王子之际，只有木法沙的弟弟刀疤（切瓦特·埃加福 Chiwetel Ejiofor 配音）妒火中烧。他久久觊觎哥哥的王位，而今更是将辛巴视为眼中钉肉中刺。经过一番策划，刀疤害死了木法沙，并将罪名推给了侄子，进而将王位攫取到自己手中。\n荣耀王国从此被黑暗笼罩，而遭到流放的辛巴是否还能回到这个他度过快乐童年的国度呢？', 'http://localhost:8888/api/upload?id=270179d4-871a-43bd-9971-79c742c964f7', '118');
INSERT INTO `t_film` VALUES ('9a7d00b645ba6bd97d9fe225d7f6183c', '小小的愿望 (2019)', '2019-09-12', '喜剧', '1', '内地', '0', '　　突然患上肌肉萎缩症的高中生高远（彭昱畅 饰），被医生告知时日不多，决心在临死之前完成一个愿望，那就是成为一个真正的男人！得知这个消息的身边两位好兄弟徐浩（王大陆 饰）和张正阳（魏大勋 饰），为了兄弟最后的愿望，不惜一切奋战到底！', 'http://localhost:8888/api/upload?id=c7918537-ca9d-4143-9882-9cb70b644a14', '107');
INSERT INTO `t_film` VALUES ('a21ac0809a293e48e922e072630b20d5', '波斯语课 Persischstunden (2020)', '2021-03-19', '历史', '1', '内地', '0', '二战期间，犹太人吉尔斯在集中营谎称自己是波斯人保命，被一位德国军官看中要求教自己波斯语。对波斯语完全不懂的吉尔斯只能凭空编出一门语言，他开始用集中营中关押的犹太人的名字作为词根，编造出上千个“波斯语”单词，军官在残暴的环境中对吉尔斯竟有了依赖，并开始袒护他，不料集中营中来了一 个真正的波斯人……', 'http://localhost:8888/api/upload?id=91538f53-b667-403d-96a7-3a0854a2e916', '127');
INSERT INTO `t_film` VALUES ('b448f793d268df1cfc089ed5a90e7bc5', '唐人街探案3', '2021-02-12', '喜剧', '1', '内地', '0', '继曼谷、纽约之后，东京再出大案。唐人街神探唐仁（王宝强 饰）、秦风（刘昊然 饰）受侦探野田昊（妻夫木聪 饰）的邀请前往破案。“CRIMASTER世界侦探排行榜”中的侦探们闻讯后也齐聚东京，加入挑战，而排名第一Q的现身，让这个大案更加扑朔迷离，一场亚洲最强神探之间的较量即将爆笑展开……', 'http://localhost:8888/api/upload?id=3bc59bc7-e3ee-4245-8f67-d9ff0ba8150a', '120');
INSERT INTO `t_film` VALUES ('dbd62f019c06c94a1994e282905b5cc5', '我的姐姐', '2021-04-02', '家庭', '1', '内地', '0', '成长于重男轻女家庭环境中的姐弟俩，原本关系冷漠疏离，但在父母车祸离世后，面临抚养弟弟还是追求个人独立生活抉择的姐姐，重新意识到了亲情深处血浓于水的意义。', 'http://localhost:8888/api/upload?id=ebcb2116-d464-4bfa-9190-0f1d13ac316e', '128');

